import { TextField } from '@material-ui/core'

export default () => {
    return (
        <form>
        <TextField 
        id="vin"
        label="VIN"
        onChange={test}
        >

        </TextField>
    </form>

    )
}


let test = function() {
    console.log("Hello")
}
